let color = '#'
  let str = '0123456789abcdef'
  function changeColor(){

    for (let i = 0; i < 6; i++) {
      let index = Math.floor(Math.random() * str.length)
      color += str[index]
    }
    return color
    console.log(color);
  }

    
function RandomColor(props) {
  return (
    <div>
      <h2 style={{backgroundColor:color}}>{changeColor()}</h2>
    </div>
  )
}

export default RandomColor
